import React, { Component } from "react";
import "./landing.css";
import { Link } from "react-router-dom";
import Footer from "../footer/footer";

class Landing extends Component {
  state = {
    name: "LAUREL DENTINGER",
    displayedName: "",
  };

  onComponentDidMount() {
    let i = 0;
    while (i < this.state.name.length) {
      setTimeout(function () {
        let newName = this.state.name.substring(0, i);
        this.setState({ displayedName: newName });
        i++;
      }, 1000);
    }
  }

  render() {
    return (
      <div id="landing">
        <div id="banner">
          <span>
            <h1>{this.state.displayedName}</h1>
          </span>
          <h2>DESIGNER | DEVELOPER</h2>
          <Link to="/projects">
            <button>Enter Site</button>
          </Link>
        </div>
        <Footer></Footer>
      </div>
    );
  }
}

export default Landing;
